import { types } from "mobx-state-tree";

const Invoice = types.model('Invoice', {
    currency: types.string,
    is_paid: false
})
.action(self => ({
    markPaid(){
        self.is_paid = true;
    }
}))
.views((self) => ({
    status() {
        return self.is_paid ? 'paid' : 'not Paid';
    }
}))

export default Invoice;
